  padding: 2rem 2rem;
`

const ProductContainer = styled.div`
  display: flex;
  > div + div {
    margin-left: 1rem;
  }
`

export const ProductRelated = () => {
  return (
    <Container>
      <ProductContainer>
        <ProductCardTall />
        <ProductCardTall />
        <ProductCardTall />
      </ProductContainer>
    </Container>
  )
}
